import React from 'react';
import './nav.css';

function Nav() {

  return (
    <div className="coverContainer">
        <div className="navbar">
            <ul className='navContainer'>
                <li>JUSTIN</li>
                <li>Home</li>
                <li>About Me</li>
                <li>Portfolio</li>
                <li>Resume</li>
                <button><li>CONTACT ME</li></button>
            </ul>
        </div>
        <div className="cover">
            <div className='nameContainer'>
                <h1>helllo</h1>
            </div>
        </div>
    </div>

  );
}

export default Nav;
